import React from "react";
import Aboutme from "./aboutimage.png";
function About() {
  return (
    <div>
      <div class="row align-items-center">
        <div class="col">One of three columns</div>
        <div class="col">One of three columns</div>
        <div class="col">One of three columns</div>
      </div>
      <div class="clearfix">
        <img
          src={Aboutme}
          class="col-md-6 float-md-end mb-3 ms-md-3"
          alt="..."
        />
      </div>
    </div>
  );
}

export default About;
